import React from 'react';
import logo from './logo.svg';
import './App.css';

var mysql = require('mysql');

var con = mysql.createConnection({host :'localhost', user : 'root', password : 'Carlsberg27', database :'twitter'})

con.connect(function(err) {
  if (err) throw err;
  con.query("SELECT name,handle,text FROM celeb_tweets", function (err, result, fields) {
    if (err) throw err;
    console.log(result);
  });
})

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
